           dbo:eventDate ?date .
  FILTER (lang(?date) = "en")
  BIND (YEAR(?date) AS ?year)
  BIND (MONTH(?date) AS ?month)
  BIND (DAY(?date) AS ?day)
  SERVICE <http://dbpedia.org/sparql> {
    SELECT ?timeZone
    WHERE {
      VALUES ?location "Canicosa de la Sierra"
      ?place dbo:city ?location ;
              dbo:timezone ?timeZone .
    }
  }
}
