PREFIX dct: <http://purl.org/dc/terms/>
PREFIX geo: <http://www.w3.org/2003/01/geo/wgs84_pos#>

SELECT ?birthPlace ?regionName WHERE {
  # Find Paolo Ballesteros' birth place
  ?person dbo:birthPlace ?birthPlace ;
           dct:title "Paolo Ballesteros" .

  # Find regions in the Philippines that use PST
  ?region dct:subject <http://dbpedia.org/resource/Philippines> ;
            geo:long ?longitude .
  FILTER(?longitude >= 120 && ?longitude <= 125) .  # Approximate longitude range for the Philippines

  # Filter regions based on time zone information (assuming PST is used in these regions)
  FILTER(CONTAINS(LANG(?region), "en") && CONTAINS(?region, "Philippine Standard Time"))

  OPTIONAL {
    ?region dct:title ?regionName .
  }
}
